UPDATE `quest_template` SET `RequiredRaces` = 690, `QuestFlags` = 4, `Details` = 'So... so I don''t think we''re going to be getting a good foothold in those mountains.$B$BTrust me, I''m not one to give up easily... but between freezing engines, nasty Vrykul women, territorial dragon want-to-bes and the half a dozen other nasties settled in the area, this just ain''t happening.$B$BDon''t let that dissuade you though! Just because we can''t get a foothold doesn''t mean we won''t get you there... one-way trips are pretty simple when you get down to it.$B$B<Ricket nods at some nearby rockets.>', `Objectives` = 'Speak to Ricket to make use of Ricket''s D16 Propelled Delivery Device to enter further into Storm Peaks.', `OfferRewardText` = '<Olut winces.>$B$BThat looked painful. It was a pretty grand entrance though.$B$BAre you here to help us find a path into Icecrown? As you can see, our first foray in that direction didn''t end too admirably. I''m thinking we might be better off breaching the place from another side.', `RewOrReqMoney` = 6800, `RewMoneyMaxLevel` = 12900 WHERE `entry` = 13060;
